text:
Tentu saja ada perubahan mencolok yang saya lakukan, yang membedakan dari source code di artikel aslinya.

Misalnya dari sisi `HTML`, saya memakai `data-` __attribute__ supaya kekinian

```  <div id="tab-headers">
    <div data-target="london" class="active">London</div>
    <div data-target="paris">Paris</div>
    <div data-target="tokyo">Tokyo</div>
  </div>

  <div id="tab-contents">
    ...
  </div>```

Sementara dari sisi `CSS`, saya memakai `Tailwind CSS`, supaya saya dianggap pandai 😁.

```@tailwind base;

@layer base {
  h1 { @apply text-4xl; }
  h2 { @apply text-3xl;  }
  h3 { @apply text-2xl;  }
}

@tailwind components;
@tailwind utilities;

body {
  @apply font-sans p-1;
}```

Sedangkan `javascriptnya`, banyak memakai __fat arrow__.

```  // Tab Headers: All Click Events
  Array.from(tabHeaders.children).forEach((tab) => {
    tab.addEventListener("click", () => {
      openTabContent(tab.dataset.target);
      tab.classList.add("active");
    });
  });```

Rinciannya dapat dilihat di berkas terlampir.

